const FunctionContextB = () => {
  return (
    <ColorTheme.Consumer>
      {(value) => {
        return (
          <div>
            <h1 style={{ backgroundColor: value.bkgB }}>Contexto B</h1>
          </div>
        )
      }}
    </ColorTheme.Consumer>
  )
}

export default FunctionContextB
